import React from 'react';
import { Line } from 'react-chartjs-2';

const rawData = [
  {"humidity": 71, "id": 297, "lightness": 86, "temperature": 10, "timestamp": "2023-05-15 10:19:31"}, 
  {"humidity": 0, "id": 298, "lightness": 86, "temperature": 10, "timestamp": "2023-05-15 10:19:31"}
];

// Chuyển đổi dữ liệu lại thành một mảng các labels và một mảng các giá trị
const labels = rawData.map((data, index) => `Sample ${index + 1}`);
const temperatureData = rawData.map(data => data.temperature);
const humidityData = rawData.map(data => data.humidity);
const lightnessData = rawData.map(data => data.lightness);

const data = {
  labels: labels,
  datasets: [
    {
      label: 'Temperature',
      data: temperatureData,
      fill: false,
      borderColor: "red",
      tension: 0.1
    },
    {
      label: 'Humidity',
      data: humidityData,
      fill: false,
      borderColor: "blue",
      tension: 0.1
    },
    {
      label: 'Lightness',
      data: lightnessData,
      fill: false,
      borderColor: "green",
      tension: 0.1
    },
  ]
};

const options = {
  scales: {
    yAxes: [
      {
        ticks: {
          beginAtZero: true, // Axis bắt đầu từ 0
        },
      },
    ],
  },
};

const MyLineChart = () => (
  <div>
    <div className='header'>
      <h1 className='title'>Line Chart</h1>
    </div>
    <Line data={data}  />
  </div>
);

export default MyLineChart;
